-- ----------------------------
-- Procedure structure for Pro_Pagecount
-- ----------------------------
DROP PROCEDURE IF EXISTS `Pro_Pagecount`;
delimiter ;;
CREATE PROCEDURE `Pro_Pagecount`(in number int, out summary int)
  READS SQL DATA 
begin 
	declare a int; 
	select count(*) into a from airports;
	set summary=(a+(number-1))/number;
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for Pro_Pagenation
-- ----------------------------
DROP PROCEDURE IF EXISTS `Pro_Pagenation`;
delimiter ;;
CREATE PROCEDURE `Pro_Pagenation`(in number int, in page_size int, in tablename varchar(500),in ordercolumn varchar(500))
  READS SQL DATA 
begin
  if number=1 then 
		set @s=concat('select * from ',tablename,' order by ',ordercolumn,' limit 0,', page_size);
	else	
		set @s=concat('select * from ',tablename,' order by ',ordercolumn,' limit ', number*page_size-page_size ,',', page_size);
	end if;

	prepare stm from @s;
	execute stm;
	deallocate prepare stm;
end
;;
delimiter ;

