DROP TRIGGER IF EXISTS `before_buy_ticket`;
delimiter ;;
CREATE TRIGGER `before_buy_ticket` BEFORE INSERT ON `tickets` FOR EACH ROW BEGIN
     IF NEW.Quantity >(SELECT seat from flights WHERE flightID= new.flightID) THEN        
 				 signal sqlstate 'HY001'
 				set message_text='not enough';
      END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table tickets
-- ----------------------------
DROP TRIGGER IF EXISTS `After_buy_ticket`;
delimiter ;;
CREATE TRIGGER `After_buy_ticket` AFTER INSERT ON `tickets` FOR EACH ROW BEGIN
if(new.confirm='confirmed' ) then
    UPDATE flights SET seat = seat- NEW.Quantity WHERE flightID= new.flightID;  
 
end if;
END
;;
delimiter ;

